import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Challenges.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAward, faChevronRight } from "@fortawesome/free-solid-svg-icons";
import axios from "axios";

const ChallengeCard = ({
  title,
  points,
  image,
  detailsLink,
  isLoggedIn,
  onRedirect,
  earned,
  onCheckConsecutiveLogins,
  challengeId,
  onShowLoginModal,
}) => {
  const handleDetailsClick = (e) => {
    if (!isLoggedIn) {
      e.preventDefault();
      onRedirect();
    } else if (challengeId === 3) {
      onCheckConsecutiveLogins();
      onShowLoginModal();
    }
  };

  return (
    <div className="challenge-item">
      <div className="challenge-card">
        <div className="image-container">
          <img src={image} alt={title} className="challenge-image" />
        </div>
        <div className="card-content">
          <h3 className="card-title">{title}</h3>
          <div className="points-section">
            <div className="points-badge">
              <FontAwesomeIcon icon={faAward} className="icons" />
              <span>{points} Points</span>
            </div>
            {earned ? (
              <div className="view-details earned">Earned</div>
            ) : (
              <Link
                to={isLoggedIn ? detailsLink : "#"}
                onClick={handleDetailsClick}
                className="view-details"
              >
                <span>View Details</span>
                <FontAwesomeIcon icon={faChevronRight} />
              </Link>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

const Challenges = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [earnedChallenges, setEarnedChallenges] = useState([]);
  const [showLoginModal, setShowLoginModal] = useState(false);
  const [loginMessage, setLoginMessage] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem("user"));
    if (user) {
      setIsLoggedIn(true);
    }
  }, []);

  const redirectToLogin = () => {
    navigate("/login");
  };

  const challenges = [
    {
      id: 1,
      title: "Think Fast, Earn Faster (Play Crosswords for Big Points!)",
      points: 2000,
      image: "https://cdn.vectorstock.com/i/1000x1000/24/42/crossword-icon-vector-9412442.webp",
      detailsLink: "/crossword",
    },
    {
      id: 2,
      title: "Calling all travel lovers! Can you ace our travel trivia?",
      points: 5000,
      image: "https://www.signupgenius.com/cms/images/groups/100-Random-Trivia-Questions-1260x630.png",
      detailsLink: "/quiz",
    },
    {
      id: 3,
      title: "10 days, 10 logins â€“ unlock your exclusive reward!",
      points: 3000,
      image: "https://static.vecteezy.com/system/resources/previews/019/872/884/large_2x/3d-minimal-user-login-page-user-authentication-concept-user-verification-concept-login-page-with-a-fingerprint-padlock-3d-illustration-free-png.png",
      detailsLink: "/",
    },
    {
      id: 4,
      title: "Plan Your Next 5 Adventures and Earn Rewards!",
      points: 5000,
      image: "https://www.ytravelblog.com/wp-content/uploads/2018/11/planning-a-trip-tips-and-challenges-2.jpg",
      detailsLink: "/",
    },
  ];

  return (
    <div className="challenges-container">
      <div className="challenges-header">
        <h2 className="challenges-title">Travel Challenges</h2>
        <p className="challenges-subtitle">
          Complete challenges to earn points and unlock exclusive rewards
        </p>
      </div>

      <div className="challenges-section">
        {challenges.map((challenge) => (
          <ChallengeCard
            key={challenge.id}
            {...challenge}
            isLoggedIn={isLoggedIn}
            onRedirect={redirectToLogin}
            earned={earnedChallenges.includes(challenge.id)}
            challengeId={challenge.id}
            onShowLoginModal={() => setShowLoginModal(true)}
          />
        ))}
      </div>

      {showLoginModal && (
        <div className="modal-overlay" onClick={() => setShowLoginModal(false)}>
          <div className="modal-content" onClick={(e) => e.stopPropagation()}>
            <h3>Consecutive Login Info</h3>
            <p>{loginMessage}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default Challenges;
